// Get html body from HTTP Request
const html = $input.first().json.data|| '';

// If the URL was passed along from previous node, use it
// (must be set in "Edit Fields" or in Loop Over Items)
const url = $('Loop Over Items').first().json.url[1] || $json["requestUrl"] || '';

// Check HTTPS
const httpsOk = (typeof url === 'string') && url.startsWith('https://');

return [{
  json: {
    url,
    html,
    httpsOk,
  }
}];

const html = $('Check HTTPS, headers & simple availability').first().json.html || '';
const url = $('Check HTTPS, headers & simple availability').first().json.url|| '';

// helpers
function find(regex) {
  const m = html.match(regex);
  return m ? m[1].trim() : null;
}

const title = find(/<title[^>]*>([\s\S]*?)<\/title>/i);
const metaDescription = find(/<meta\s+name=["']description["']\s+content=["']([\s\S]*?)["']/i) || find(/<meta\s+content=["']([\s\S]*?)["']\s+name=["']description["']/i);
const canonical = find(/<link[^>]*rel=["']canonical["'][^>]*href=["']([^"']+)["']/i);
const ogTitle = find(/<meta[^>]*property=["']og:title["'][^>]*content=["']([^"']+)["']/i);
const jsonLdMatch = html.match(/<script[^>]*type=["']application\/ld\+json["'][^>]*>([\s\S]*?)<\/script>/i);
const hasJsonLd = !!jsonLdMatch;

// find images
const imgRegex = /<img[^>]+src=["']([^"']+)["'][^>]*>/gi;
let m;
const imgs = [];
while ((m = imgRegex.exec(html)) !== null) imgs.push(m[1]);

// trust signals
const hasPrivacy = /href=["'][^"']*(privacy|privacy-policy)[^"']*["']/i.test(html);
const hasContact = /href=["'][^"']*(contact|contact-us|\/contact)[^"']*["']/i.test(html);
const hasTestimonials = /(testimonial|reviews|what people say|customer feedback)/i.test(html.slice(0, 5000));

return [{
  json: {
    url,
    title,
    metaDescription,
    canonical,
    ogTitle,
    hasJsonLd,
    imgs,
    hasPrivacy,
    hasContact,
    hasTestimonials,
    html
  }
}];

const url = items[0].json.url;
let html = items[0].json.html || '';
const title = items[0].json.title || 'Landing Page';
const description = items[0].json.metaDescription || 'Short page description for SEO.';
const siteName = url.match(/^https?:\/\/([^\/]+)/)?.[1] || 'default.com';

const jsonLd = {
  "@context": "https://schema.org",
  "@graph": [
    {
      "@type": "Organization",
      "name": siteName,
      "url": `https://${siteName}`,
      "logo": `https://${siteName}/logo.png`
    },
    {
      "@type": "WebPage",
      "url": url,
      "name": title,
      "description": description,
      "isPartOf": { "@type": "WebSite", "url": `https://${siteName}` }
    }
  ]
};

const jsonLdString = `<script type="application/ld+json">\n${JSON.stringify(jsonLd, null, 2)}\n</script>\n`;

// inject JSON-LD before </head>
if (html.includes('</head>')) {
  // remove existing application/ld+json block (basic)
  html = html.replace(/<script[^>]*type=["']application\/ld\+json["'][^>]*>[\s\S]*?<\/script>/i, '');
  html = html.replace('</head>', jsonLdString + '</head>');
}

// ensure meta description
if (!/name=["']description["']/i.test(html)) {
  html = html.replace('</head>', `<meta name="description" content="${description}">\n</head>`);
}

// ensure title
if (!/<title[^>]*>/i.test(html)) {
  html = html.replace('</head>', `<title>${title}</title>\n</head>`);
}

// ensure canonical
if (!/rel=["']canonical["']/i.test(html)) {
  html = html.replace('</head>', `<link rel="canonical" href="${url}" />\n</head>`);
}

return [{ json: { url, html, report: { addedJsonLd: true, description, title } } }];

const lighthouse = $json.lighthouseResult || {};
const categories = lighthouse.categories || {};
const perf = categories.performance?.score ?? 0;

return [{
  json: {
    url: $json.id || $json.requestedUrl,
    performanceScore: perf * 100 // PageSpeed returns 0–1, so multiply by 100
  }
}];
